description: 'Representative EIS data of G1 and G2 electrodes for all channels in
  this UO1 project.

  For G1 electrodes, the relationship between the diameter of electrode contacts and
  the electrode number is as follows:

  5 (um): 2, 9, 16, 24

  10: 1, 11, 23, 31

  15: 8, 10, 22, 30

  20: 3, 15, 21, 25

  25: 6, 7, 12, 26

  30: 13, 18, 19, 27

  40: 4, 14, 20 28

  50: 5, 17, 29, 32

  For G2 electrodes, the relationship between the diameter of electrode contacts and
  the electrode number is as follows:

  5 (um): 2, 3, 4, 5, 6, 7, 17, 18, 19, 20, 22

  10: 9, 12, 13, 14, 15, 16, 25, 26, 27, 28, 29, 32

  circuit: 1-8, 11-30

  terminal: 23, 31

  reference (4004 um^2): 10, 24'
